trailingComments.value:
function* (start, end, step=1){
    if(isUndefined(end)){
        yield* range(0, start);
        return;
    }
    const stepAbs = step = Math.abs(step) || 1;
    if(start > end)step = -step;
    while(Math.abs(end - start) >= stepAbs){
        yield start;
        start += step;
    }
    yield start;
};
//

